import React from 'react';
import { Form, Input } from 'antd';

const dummy = {
    isLoggedIn: true,
};

const Home = () => {
    return (
        <div>
            {dummy.isLoggedIn && <Form encType="multipart/form-data">
                <Input.TextArea maxLength={140} placeholder="어떤 신기한 일이 있었나요?" />
            </Form>}
        </div>
    );
};

export default Home;
